#[derive(Default)]
struct Checker {
    pub success: Arc<Mutex<bool>>
}

impl Actor for Checker {
    type Context = Context<Self>;
}

impl Handler<NodeEstimationDone> for Checker {
    type Result = ();

    fn handle(&mut self, _msg: NodeEstimationDone, _ctx: &mut Self::Context) -> Self::Result {
        // nothing to do here
    }
}

impl Handler<CheckingMessage> for Checker {
    type Result = ();

    fn handle(&mut self, _msg: CheckingMessage, _ctx: &mut Self::Context) -> Self::Result {
        *(self.success.lock().unwrap()) = true;
    }
}


#[derive(Message)]
#[rtype(Result = "()")]
struct CheckingMessage {
    pub rec: Option<Recipient<CheckingMessage>>
}


impl Handler<CheckingMessage> for Training {
    type Result = ();

    fn handle(&mut self, msg: CheckingMessage, _ctx: &mut Self::Context) -> Self::Result {
        println!("{:?}", self.node_estimation.nodes.get(&92).unwrap());
        close_l1(self.node_estimation.nodes.get(&92).unwrap(), &arr2(&[[862.44900531], [709.53277102], [556.61652615], [403.70025919], [250.78392674], [123.35325327]]), 0.0005);

        msg.rec.unwrap().do_send(CheckingMessage { rec: None }).unwrap();
    }
}


#[actix_rt::test]
async fn test_node_estimation() {
    let _cluster = Cluster::new(format!("127.0.0.1:{}", request_open_port().unwrap_or(8000)).parse().unwrap(), vec![]);
    let parameters = Parameters::default();
    let mut training = Training::new(parameters);

    let success = Arc::new(Mutex::new(false));
    let checker = Checker { success: success.clone() }.start();

    training.intersection_calculation = IntersectionCalculation {
        intersections: generate_intersections(),
        intersection_coords_by_segment: generate_intersection_coords(),
        helpers: None,
        pairs: vec![],
        ..Default::default()
    };

    training.node_estimation.source = Some(checker.clone().recipient());

    let training_addr = training.start();
    training_addr.do_send(IntersectionCalculationDone);
    delay_for(Duration::from_millis(3000)).await;
    training_addr.do_send(CheckingMessage{ rec: Some(checker.recipient()) });
    delay_for(Duration::from_millis(200)).await;
    assert!(*success.lock().unwrap())
}


